    }
  }
  componentDidMount(){
    this.count();
  }

  count = ()=>{
    setInterval(() => {
        var secound = this.state.secound+1;
        this.setState({secound : secound});
    }, 1000);
  }

  render() {
    var today = new Date();
    var dateToDay = today.getFullYear()+'-'+today.getMonth()+'-'+today.getDate();

    return (
      <div style={{textAlign:"center"}}>
        <Header />
        <h3>To Day is : {dateToDay} : {this.state.secound}</h3>
      </div>
    )
  }
}

